import Head from "next/head";
function Layout(props) {
  return (
      <div className="">
          {/* Settimg Page Head */}
      <Head>
              <title>{props.title}</title>
              <link rel="stylesheet" href="/css/global.css"></link>
      </Head>

      {/* Navbar */}
      {/* Content */}
      {props.children}
    </div>
  );
}
export default Layout;
